import React from 'react';
import { useAppDispatch, useAppSelector } from 'store/hooks/hooks';
import { setWinnersSortBy, setWinnersSortDirection } from 'store/modules/listReducer';
import ToggleButton from '../ToggleButton/ToggleButton';


import styles from './WinnerTableHead.module.scss';

function WinnerTableHead() {
   const dispatch = useAppDispatch();
   const winnersList = useAppSelector( store => store.list.winnersList );

   return(
      <div className={ styles.winnerTableHead }>
         <ToggleButton  
            name="sortBy" 
            valueOne="by Win" 
            valueTwo="by Time" 
            startValue={null} 
            onToggle={(newValue: string | null) => {
               if (newValue !== null) {
                  dispatch(setWinnersSortBy(newValue));
               }
            }}
            uncheckedValue={null}
         />
         <ToggleButton  
            name="sortDirection" 
            valueOne="increasing" 
            valueTwo="decreasing" 
            startValue={null} 
            onToggle={(newValue: string | null) => {
               if (newValue !== null) {
                  dispatch(setWinnersSortDirection(newValue));
               }
            }}
            uncheckedValue={null}
         />
      </div>
   )
}

export default WinnerTableHead;
